module.exports['components/teaser/components/teaser_heading.hbs'] = '{{#with _label}}\n    <div class="leading-5.5{{#if ../_ordered}} pl-8 {{/if}}">\n        {{> components/label/label _type=this.type _text=(loca this.loca) _css=../_css}}\n    </div>\n{{/with~}}\n\n<{{~ _headlineTag ~}}>\n    {{#if _topline}}\n        {{> components/teaser/components/teaser_topline _css=_css _text=_topline _readMore=_readMore _teaserType=_teaserType}}\n    {{/if}}\n    {{> components/teaser/components/teaser_title _css=_css _text=_title _fontVariant=_fontVariant _size=_size _teaserType=_teaserType _isMobile1to1=_isMobile1to1 _firstItem=_firstItem}}\n</{{~ _headlineTag ~}}>\n'
